                    {/* {this.props.records.map((record) => { return <FilaRecords nick={record.nick} puntos={record.puntos} /> })}  */}
                    {contenidoTabla.map((v) => {
                        return (v);
                    })}

                </tbody>

            </table>
        )


    }
}

